import{_ as i,c as e,o as l,d as a}from"./app.a7742670.js";const g=JSON.parse('{"title":"Все про влагозащиту","description":"","frontmatter":{},"headers":[{"level":2,"title":"Зачем нужно покрывать электронику?","slug":"зачем-нужно-покрывать-электронику","link":"#зачем-нужно-покрывать-электронику","children":[]},{"level":2,"title":"Какие есть варианты герметиков для электроники?","slug":"какие-есть-варианты-герметиков-для-электроники","link":"#какие-есть-варианты-герметиков-для-электроники","children":[{"level":3,"title":"Пластик-71, купить можно здесь","slug":"пластик-71-купить-можно-здесь","link":"#пластик-71-купить-можно-здесь","children":[]},{"level":3,"title":"MG Chemicals 422B, снят с произодства","slug":"mg-chemicals-422b-снят-с-произодства","link":"#mg-chemicals-422b-снят-с-произодства","children":[]},{"level":3,"title":"MG Chemicals 422C, пропадает из вида","slug":"mg-chemicals-422c-пропадает-из-вида","link":"#mg-chemicals-422c-пропадает-из-вида","children":[]},{"level":3,"title":"Spinner protection silicone conformal coating V2 (спинер жижа v2) купить можно здесь","slug":"spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь","link":"#spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь","children":[]},{"level":3,"title":"DCA Electrolube, купить можно здесь","slug":"dca-electrolube-купить-можно-здесь","link":"#dca-electrolube-купить-можно-здесь","children":[]},{"level":3,"title":"KOTKING, если не доступно тут, ищите на teamblacksheep или в барахолке","slug":"kotking-если-не-доступно-тут-ищите-на-teamblacksheep-или-в-барахолке","link":"#kotking-если-не-доступно-тут-ищите-на-teamblacksheep-или-в-барахолке","children":[]},{"level":3,"title":"FX_FPV AeroX, снят с производства","slug":"fx-fpv-aerox-снят-с-производства","link":"#fx-fpv-aerox-снят-с-производства","children":[]},{"level":3,"title":"Клей B-7000, купить можно здесь","slug":"клеи-b-7000-купить-можно-здесь","link":"#клеи-b-7000-купить-можно-здесь","children":[]},{"level":3,"title":"Герметик K-705, купить можно здесь","slug":"герметик-k-705-купить-можно-здесь","link":"#герметик-k-705-купить-можно-здесь","children":[]},{"level":3,"title":"Китайская защита для плат ip65, купить можно здесь","slug":"китаиская-защита-для-плат-ip65-купить-можно-здесь","link":"#китаиская-защита-для-плат-ip65-купить-можно-здесь","children":[]},{"level":3,"title":"Жидкая изолента","slug":"жидкая-изолента","link":"#жидкая-изолента","children":[]}]}],"relativePath":"community/coating.md"}'),r={name:"community/coating.md"},t=a('<h1 id="все-про-влагозащиту" tabindex="-1">Все про влагозащиту <a class="header-anchor" href="#все-про-влагозащиту" aria-hidden="true">#</a></h1><h2 id="зачем-нужно-покрывать-электронику" tabindex="-1">Зачем нужно покрывать электронику? <a class="header-anchor" href="#зачем-нужно-покрывать-электронику" aria-hidden="true">#</a></h2><p>Без защитного покрытия летать в снег и дождь на дронах рисковая затея-при попадании влаги на работающую электронику возможны (и в большинстве случаев возникают) глюки в виде внезапного отказа двигателей, потери связи, а при падении в соленую воду(море) окислы и повреждение схемы.</p><h2 id="какие-есть-варианты-герметиков-для-электроники" tabindex="-1">Какие есть варианты герметиков для электроники? <a class="header-anchor" href="#какие-есть-варианты-герметиков-для-электроники" aria-hidden="true">#</a></h2><p>На 2022 год актуальны следующие варианты:</p><ul><li>KOTKING (RC coating)</li><li>силиконовые герметики по типу k-705</li><li>клей B-7000</li><li>mg chemicals 422С (силиконовое защитное покрытие)</li><li>DCA Electrolube (прозрачный лак на основе модифицированного силикона)</li><li>Spinner protection silicone conformal coating V2 (спинер жижа v2)</li><li>FX_FPV AeroX (аналог коткинга)</li><li>китайская силиконовая защита для плат ip65</li></ul><p>Немного о каждом из них:</p><h3 id="пластик-71-купить-можно-здесь" tabindex="-1">Пластик-71, <a href="https://www.chipdip.ru/product/plastik-71-100" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#пластик-71-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Пластик-71 изначально зарекомендовал себя как самый доступный, поскольку продается в каждом радиомагазине, но неудачный вариант, так как при эксплуатации очень быстро трескается и пропускает всю влагу. Можно наносить в несколько слоев, тогда больше вероятность, что он дольше продержится, но гарантий особо нет. Также есть мнение, что в зависимости от производителя состав отличается, были отзывы, что отлично справляется со своей задачей, но таких отзывов совсем мало. Итого:</p><ul><li>дешевый (до 200р за флакон до 100мл)</li><li>доступный (можно купить в любом радиомагазине)</li></ul><ul><li>не гарантирует влагозащиту, так как трескается со временем.</li></ul><p><b>Хоббисты не рекомендуют к эксплуатации.</b></p><p><img src="https://cdn1.ozone.ru/s3/multimedia-1/wc1200/6125209837.jpg" alt="minipic"></p><h3 id="mg-chemicals-422b-снят-с-произодства" tabindex="-1">MG Chemicals 422B, <a href="https://www.farnell.com/datasheets/2614568.pdf" target="_blank" rel="noreferrer">снят с произодства</a> <a class="header-anchor" href="#mg-chemicals-422b-снят-с-произодства" aria-hidden="true">#</a></h3><p>Лак. Долгое время был относительно доступным, продавался в ЧипДип в небольших флаконах, канистрами в розничных магазинах, тюбиками по 20-25мл в spinner production и воздушном хобби (ВХ) под видом спинер жижи, а под конец как &quot;ВХ 422B&quot;. Был неким компромиссом, стоил в районе 300-400р за 20мл, чего хватало на год активного использования, слой схватывался за минут 10, за 15 уже застывал, но рекомендовалось для полного высыхания ждать сутки в комнатной температуре. 1 слоя было достаточно, чтобы защитить от влаги, но когда температура понижалась(полеты зимой), она начинала трескаться и пропускала влагу. В 2021 году прекратилось производство, теперь нигде не купить. Альтернативой стала версия 422С.</p><h3 id="mg-chemicals-422c-пропадает-из-вида" tabindex="-1">MG Chemicals 422C, <a href="https://www.mgchemicals.com/products/conformal-coatings/silicone-conformal-coatings/conformal-coating-waterproof/" target="_blank" rel="noreferrer">пропадает из вида</a> <a class="header-anchor" href="#mg-chemicals-422c-пропадает-из-вида" aria-hidden="true">#</a></h3><p>Лак. Есть много разных отзывов, на деле лично не удалось попробовать (у кого есть опыт, просьба дополнить статью), предположительно по эксплуатации схоже с 422b, только более жидкий и сохнет дольше (по 30-40 минут застывает 1 слой). Некоторое время продавался как раньше 422b, только под другим названием, сейчас постепенно исчезает из тех же магазинов. Итого:</p><ul><li>из средней ценовой категории (700р за 20мл в ВХ был в 2022)</li><li>можно паять через нанесенный слой</li><li>легко снять щеткой со спиртом или ацетоном (и нет, ацетон не разъедает моментально пластик и надписи, разве что если вы на сутки в ацетоне замочите плату)</li></ul><ul><li>в РФ уже не так просто найти</li><li>долго сохнет</li><li>не гарантирует 100% влагозащиту</li></ul><p><img src="https://air-hobby.ru/components/com_virtuemart/shop_image/product/422_silikonovoe_zaschitnoe_pokrytie_18ml_5f748e262abf2.jpg" alt="minipic"></p><h3 id="spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь" tabindex="-1">Spinner protection silicone conformal coating V2 (спинер жижа v2) <a href="https://www.spinnerproduction.ru/catalog-0-846" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#spinner-protection-silicone-conformal-coating-v2-спинер-жижа-v2-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Многие предположат, что это DCA или 422C, но у него другой состав (со слов продавца). Личного не проверяла (у кого есть опыт, просьба дополнить статью). Стоит 600р за 20мл. По отзывам поведение схоже с 422C - долго сохнет и не идеально защищает от влаги.</p><p><img src="https://www.spinnerproduction.ru/crop_image/spinner/mainr846tekstil-tekstil-20210607_223838.jpg" alt="minipic"></p><h3 id="dca-electrolube-купить-можно-здесь" tabindex="-1">DCA Electrolube, <a href="https://air-hobby.ru/katalog/product/2286-dca-electrolube-prozrachniy-lak-na-osnove-modifitsirovannogo-silikona-20ml.html" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#dca-electrolube-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Продается как и 422C, жидкая, сохнет очень долго, положительных отзывов меньше, чем на вышеперечисленные аналоги.</p><p><img src="https://air-hobby.ru/components/com_virtuemart/shop_image/product/lectrolube_prozrachnyy_lak_na_osnove_modificirovannogo_silikona_25ml_59fb07f1eb67b.jpg" alt="minipic"></p><h3 id="kotking-если-не-доступно-тут-ищите-на-teamblacksheep-или-в-барахолке" tabindex="-1">KOTKING, <a href="https://www.fpvmatrix.ru/index.php?route=product/product&amp;product_id=339&amp;search=kotking" target="_blank" rel="noreferrer">если не доступно тут, ищите на teamblacksheep или в барахолке</a> <a class="header-anchor" href="#kotking-если-не-доступно-тут-ищите-на-teamblacksheep-или-в-барахолке" aria-hidden="true">#</a></h3><p>Силикон. Коткинг всегда был товаром премиум класса, продавался в основном за рубежом, лишь последнее время появилась пара диллеров в РФ, а цена всегда была выше, чем у аналогов. Представляет собой тюбик небольшого объема с жидким силиконом внутри. Объема хватает, чтобы покрыть не самым толстым слоем три коптера(подразумеваю электронику). Застывает очень долго, по инструкции он должен схватываться за 15-20 минут, но на личном опыте приходилось ждать не менее часа, иначе целпялся при касании и вытягивался, при этом слой наносила относительно тонко. Присутствует неприятный запах. Покрытие достаточно надежное, подтверждением тому ролики, как коптеры с покрытой им электроникой отлично работают под водой. Если не было ручного вмешательства, он остается целостным слоем и защищает платы на отлично. Невозможно паять через нанесенный слой. Снимать не особо удобно, напоминает желе, нельзя подцепить с краю и стянуть весь слой с платы, отрывается кусочками. Ацетоном не смывается. Но поговаривают, что можно снять с помощью растворителя 646 и щетки (если есть такой опыт, просьба дописать). Немаловажный неприятный момент: при длительном хранении(несколько месяцев) засыхает внутри тюбика. Практически не имеет запаха. Итого:</p><ul><li>надежно защищает от влаги</li></ul><ul><li>не так доступен, как аналоги, ввиду санкций зарубежные магазины могут не поставлять, а у хоббистов не всегда есть для продажи</li><li>дорогой (15мл за 12$, в РФ часто по ~1300р)</li><li>долго не хранится даже в запакованном виде</li><li>тюбика хватает максимум на 3 коптера</li><li>имеет неприятный запах</li><li>не смывается ацетоном, нужно поддевать и снимать кусочно</li><li>нельзя паять через нанесенный слой</li></ul><p><img src="https://kotking.com/wp-content/uploads/2021/12/new02-1536x864.jpg" alt="minipic"></p><h3 id="fx-fpv-aerox-снят-с-производства" tabindex="-1">FX_FPV AeroX, <a href="https://quadro.team/goods/aerox" target="_blank" rel="noreferrer">снят с производства</a> <a class="header-anchor" href="#fx-fpv-aerox-снят-с-производства" aria-hidden="true">#</a></h3><p>Силикон. Новинка 2022 года, состав схож с составом коткинга, поскольку по густоте, времени засыхания, получаемому покрытию, адгезии к электронике очень схожи. Схватывается за 15 минут(еще липкий, но уже не растекается), застывает за 30 минут. В отличие от коткинга не имеет запаха. Снимается так же, как коткинг-путем поддевания и отрывания кусочно, ацетоном не разъедается. Но есть хитрость-можно подержать в смеси галоша+изопропанол 15 мин, сойдет одним слоем. Невозможна пайка через нанесенный слой. Благодаря кисти легко наносить тонким слоем, расход меньше, чем у коткинга. Без внешнего воздействия сохраняет целостность. По времени хранения не превосходит коткинг, после вскрытия и нескольких использований спустя месяц загустел так сильно, что стал непригоден для эксплуатации, хотя закрывался плотно и не стоял открытым долго. Спиртом развести не получится, не взаимодействуют. Итого:</p><ul><li>доступен только в РФ</li><li>из средней ценовой категории (950р за 20мл)</li><li>надежно защищает от влаги</li><li>хорошая адгезия</li><li>отсутствует запах</li><li>для снятия нужно отмочить в смеси галоша + изопропанол 15 мин или снимать кусочно</li></ul><ul><li>после вскрытия долго не хранится</li><li>нельзя паять через нанесенный слой</li></ul><p><img src="https://i1.stat01.com/2/6877/168763447/075a3e/photo2022-03-3122-19-17-jpg.jpg" alt="minipic"></p><h3 id="клеи-b-7000-купить-можно-здесь" tabindex="-1">Клей B-7000, <a href="https://www.wildberries.ru/catalog/14059777/detail.aspx" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#клеи-b-7000-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Клей B-7000, несмотря на то, что клей, также отлично справляется с задачей влагозащиты, устойчив к температурам, которые достигаются электроникой в простоях. Стоит дешево, много где продается. Нанесенный слой не прозрачен, остается много пузырьков с воздухом. Можно паять через него, но занятие не из самых приятных, выделяется ужасный запах. Если слой свежий, можно снять путем наматывания на пинцет. Если слой старый, сходит только после отмачивания в ацетоне на протяжении 10 минут или наматыванием после прогрева, но периодически отрывается вместе с элементами с платы. Итого:</p><ul><li>дешевый (до 200р за тюбик до 50мл)</li><li>доступный</li><li>надежно защищает от влаги</li><li>быстро засыхает</li></ul><ul><li>при попытке паять через него выделяется едкий запах</li><li>при снятии иногда отрывается с элементами платы</li></ul><p><img src="https://avatars.mds.yandex.net/get-mpic/5288781/img_id9048331639805302261.jpeg/orig" alt="minipic"></p><h3 id="герметик-k-705-купить-можно-здесь" tabindex="-1">Герметик K-705, <a href="https://air-hobby.ru/katalog/product/3737-silikonoviy-kley-germetik-705-prozrachniy-50-ml.html" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#герметик-k-705-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Силикон. Текучий герметик для заливки плат. Через него невозможно паяться, но возможно оторвать кусочек на месте под пайку и потом залить снова. Практически не пахнет. Без внешнего воздействия сохраняет целостность. Итого:</p><ul><li>дешевый (до 400р за тюбик 45г)</li><li>доступный</li><li>надежно защищает от влаги</li><li>практически не пахнет</li><li>быстро засыхает</li></ul><ul><li>не смывается ацетоном, нужно поддевать и снимать кусочно</li><li>нельзя паять через него</li></ul><p><img src="https://aliradar.com/api/image?url=https%3A%2F%2Fae01.alicdn.com%2Fkf%2FHTB1y0szNhYaK1RjSZFnq6y80pXan%2F705-Silicone-Clear-Sealing-Glue-Waterproof-Heat-Resist-For-Electron-Component-Adhesives-Sealers.jpg_220x220.jpg_Q70.jpg_.webp" alt="minipic"></p><h3 id="китаиская-защита-для-плат-ip65-купить-можно-здесь" tabindex="-1">Китайская защита для плат ip65, <a href="https://a.aliexpress.com/_mKX5LuM" target="_blank" rel="noreferrer">купить можно здесь</a> <a class="header-anchor" href="#китаиская-защита-для-плат-ip65-купить-можно-здесь" aria-hidden="true">#</a></h3><p>Лак. Напоминает 422B, но более вязкий. Также с едким запахом. Засыхает за 15 минут, для полного высыхания лучше подождать сутки, как и при использовании других лаков. 1 слоя достаточно. Можно паять через нанесенный слой, смывается щеткой с ацетоном. На личном опыте пока не подводила, не трескалась. Тюбик лучше не оставлять открытым, так как густеет. Объема хватит на очень долго, быстрее высохнет, чем закончится, если не разделить по тюбикам. Итого:</p><ul><li>дешевая (8$ за 100мл)</li><li>среди аналогов 422C, dca, спинер жижи в2 больше всех внушает доверие</li><li>легко смывается</li><li>быстро засыхает</li><li>хорошая адгезия</li><li>можно паять через нанесенный слой</li></ul><ul><li>не самый доступный вариант, купить можно только на алиэкспресс</li><li>имеет едкий запах</li></ul><p><img src="https://ae04.alicdn.com/kf/S96c49d979a85429bb51021eaedfa4832M/-.jpg" alt="minipic"></p><h3 id="жидкая-изолента" tabindex="-1">Жидкая изолента <a class="header-anchor" href="#жидкая-изолента" aria-hidden="true">#</a></h3><p>Предложен еще один вариант, не особо популярный - жидкая изолента. Обезжириваете спиртом электронику, сушите, наносите слой. Засыхает слой за 15-20 минут. Снимается одним слоем как изолента. Стоимость спрея 500мл до 900р. Позже будет добавлена ссылка.</p>',53),n=[t];function o(c,p,h,s,d,m){return l(),e("div",null,n)}const f=i(r,[["render",o]]);export{g as __pageData,f as default};
